import React, { Component } from 'react'

export default class Navbar extends Component {
    render() {
        return (
            <div className="navbar">
            <div className="">
                <h1> {`<News Tracking/>`} </h1>
            </div>
            <div className="utils">
                <p> Register </p>
                <p> Login </p>
            </div>
        </div>
        )
    }
}
